import React from 'react';
import './App.css';

import Home from './views/Home.js';
import ProductSearch from './views/ProductSearch.js';
import Navbar from './component/Navbar/Navbar.js';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Switch>
          <Route path='/' exact>
            <Home />
          </Route>
          <Route path='/shop'>
            <ProductSearch />
          </Route>
        </Switch>
      </Router>

    </div>
  );
}

export default App;
